import pytest
from face_classificators.face_classificator import age_and_gender_predictor,readbase64
import numpy as np

base64 = "data:image/jpeg;base64,"
base64_no_face = "data:image/jpeg;base64,"
img = np.loadtxt("test.txt").reshape((522, 522, 3))
bad_format_base64 = "sakjfhsdk"


def test_img_format():
    assert readbase64(base64).all() == img.all()

def test_bad_forat():
    assert readbase64(bad_format_base64) == "bad data format"

def test_face_detected():
    assert age_and_gender_predictor(base64) == ("(25 - 32)", "Male")

def test_bad_data_format():
    assert age_and_gender_predictor(bad_format_base64) == ("bad data format",120)

def test_no_face_detected():
    assert age_and_gender_predictor(base64_no_face) == ("no face detected",121)
